import React from 'react';
const Users = () =>{
 const data = [
  {title : 'Test user1' , id : 1},
  {title : 'test user2' , id : 2},
  {title : 'Test user3' , id : 3},
  {title : 'Test user4' , id : 4},
  {title : 'Test user5' , id : 5},
 ]


 const listItems = data.map(names =>
   <li key = {names.id}>
    {names.title}

   </li>
);

return(
  <ul >
   {listItems}
  </ul>
);
}

export default Users;
